package main

import (
	"fmt"
	"strconv"
	"strings"
)

func main() {
	in := `
		
		
		
		
		
	`
	buttons := pressButtons(in)
	fmt.Printf(buttons)
}

func pressButtons(in string) string {
	start := 5
	buttonInstructions := getInstructions(in)
	buttons := make([]string, len(buttonInstructions))
	pos := 0
	for _, buttonInstruction := range buttonInstructions {
		button := getButton(start, buttonInstruction)
		pressButton(buttons, pos, button)
		pos = pos + 1
	}
	return strings.Join(buttons, "")
}

func getInstructions(s string) []string {
	return strings.FieldsFunc(s, func(r rune) bool {
		switch r {
		case ' ', '\t', '\n':
			return true
		}
		return false
	})
}

func getButton(start int, instruction string) int {
	end := start
	for _, c := range instruction {
		end = move(end, c)
	}
	return end
}

func pressButton(buttons []string, pos int, button int) {
	buttons[pos] = strconv.Itoa(button)
}

// 1 2 3
// 4 5 6
// 7 8 9
// U D L R
func move(start int, instruction rune) int {
	end := start
	switch instruction {
	case 'U':
		end = end - 3
		if end < 1 || end > 9 {
			return start
		}
	case 'D':
		end = end + 3
		if end < 1 || end > 9 {
			return start
		}
	case 'L':
		end = end - 1
		if start == 1 || start == 4 || start == 7 {
			return start
		}
	case 'R':
		end = end + 1
		if start == 3 || start == 6 || start == 9 {
			return start
		}
	}
	return end
}
